import React from "react";

function page_home(){
    return(<p>I am web developer based in the UK. I graduated Sheffield Hallam with MSc in Web Systems Design degree in 2016. Since then I mostly worked in agencies, I cut my teeth on PHP, majority through Wordpress, but also Drupal. 
        <p>My career goal is to continue pursuing React / more Javascript based languages, whether alongside Wordpress or stand-alone.</p>
    </p>)
}

export default page_home;
